						["custom"] = "function (allstates, event)\n    if IsInJailersTower() then \n        for _, state in pairs(allstates) do\n            state.show = false;\n            state.changed = true;\n        end\n        local powersTbl = {[1]={},[2]={},[3]={},[4]={}}\n        for i=1, BUFF_MAX_DISPLAY do\n            local name, icon, count, _, _, _, _, _, _, spellID = UnitAura(\"player\", i, \"MAW\");\n            local link = GetSpellLink(spellID)\n            local rarityID = aura_env.rarityTbl[spellID]\n            if not rarityID then rarityID=1 end\n            \n            if icon then\n                \n                local tbl = {\n                    show = true,\n                    changed = true,\n                    name = name,\n                    icon = icon,\n                    progressType = \"static\",\n                    autoHide = false,\n                    link = link,\n                    spellID = spellID,\n                    rarity = rarityID\n                    \n                }\n                if count == 0 then\n                    count = 1;\n                end\n                if count>1 then\n                    tbl[\"custom\"]=count\n                end\n                \n                tinsert(powersTbl[rarityID], tbl)\n                \n            end\n        end\n        local i = 0\n        for _,n in pairs({4,3,2,1}) do\n            local rarityTbl = powersTbl[n]\n            for _, stateTbl in pairs(rarityTbl) do\n                i=i+1\n                stateTbl.index = i\n                allstates[\"mawpower_\"..stateTbl.spellID]=stateTbl\n            end\n            \n        end\n        \n        \n        \n        return true\n    end\n    \n    return false\nend\n\n\n",
